import React, { useState } from 'react';
import './Navbar.css';

import cart from '../Media/cart.png';
import gymshark from '../Media/Gymshark-Logo-700x394.png';

import { auth, provider } from '../firebaseConfig';
import { signInWithPopup } from 'firebase/auth';
import {Link} from "react-router-dom";


const Navbar = () => {

const[menu,setMenu] =useState("shop");


    return (
        <div className='navbar'>
            <div className="nav-logo">

                <p>GymShark</p>
            </div>
            <ul className="nav-menu">
                <li  onClick={() => {setMenu('shop')}}><Link to='/'>Shop</Link>{menu==="shop"?<h/>:<></>}</li>
                <li  onClick={() => {setMenu('women')}}><Link to='/'>WOMEN</Link>{menu==="women"?<h/>:<></>}</li>
                <li  onClick={() => {setMenu('men')}}><Link to='/'>MEN</Link>{menu==="men"?<h/>:<></>}</li>
                <li  onClick={() => {setMenu('accessories')}}><Link to='/'>ACCESSORIES</Link> {menu==="accessories"?<h/>:<></>}</li>
            </ul>
            <div className="nav-login-cart">
                <button>Login</button>
                <Link to ='/Cart'><img src={cart} alt='cart'/></Link>
                <div className="nav-cart-count">0</div>
            </div>
        </div>
    );
};

export default Navbar;
